import React, { useState } from 'react'
import {BrowserRouter,Route,Routes,Link} from 'react-router-dom'

import Home from './Home'
import About from './About'
import Gallary from './Gallary'
import PageNotFound from './PageNotFound'
import Services from './Services';
import Contact from './Contact'


export default function Project() {
  const white={color:'white'}

  const[color,setcolor]=useState(white)
  return (
    <div >
            <BrowserRouter >   
            {/* <ul style={{display:'flex', backgroundColor:'lightgray', height:50, alignItems:'center',backgroundImage:"unset",float:'right',listStyleType:'none'}}> */}
            <ul style={{width:'100%',backgroundColor:'burlywood',display:'flex',float:'left',position:'',marginTop:0,justifyContent:'space-evenly', minHeight:70,alignItems:'center',listStyleType:'none'}}>
                <li style={{fontSize:20, fontWeight:'bold'}} onMouseMove={()=>setcolor(white)}><Link to="/" style={{color:'black',textDecoration:'none'}}>Home</Link></li>&nbsp;&nbsp;&nbsp;&nbsp;
                <li style={{fontSize:20, fontWeight:'bold'}}><Link to="/about" style={{color:'black', textDecoration:'none'}}>About Us</Link></li>&nbsp;&nbsp;&nbsp;&nbsp;
                <li style={{fontSize:20, fontWeight:'bold'}}><Link to="/gallary" style={{color:'black', textDecoration:'none'}}>Gallary</Link></li>&nbsp;&nbsp;&nbsp;&nbsp;
                <li style={{fontSize:20, fontWeight:'bold'}}><Link to="/contact" style={{color:'black', textDecoration:'none'}}>Contact</Link></li>&nbsp;&nbsp;&nbsp;&nbsp;
                <li style={{fontSize:20, fontWeight:'bold'}}><Link to="/service" style={{color:'black', textDecoration:'none'}}>Services</Link></li>&nbsp;&nbsp;&nbsp;&nbsp;
                {/* <li><Link to="*">PageNotFound</Link></li> */}
            </ul>

            <Routes>
                <Route path="/" exact={true} element={<Home/>}></Route>
                <Route path="/about" element={<About/>}></Route>
                <Route path="/gallary" element={<Gallary/>}></Route>
                <Route path="/contact" element={<Contact/>}></Route>
                <Route path="/service" element={<Services/>}></Route>
                <Route path="/*" element={<PageNotFound/>}></Route>
            </Routes>
            </BrowserRouter>
        
    </div>
  )
}
